import styled from "styled-components"

const Navbar = () => {
    return (
        <Nav>
            <Group>
                <a>Test 1</a>
                <a>Test 2</a>
                <a>Test 3</a>
                <a>Test 4</a>
            </Group>
        </Nav>
    )
}

const Nav = styled.nav`
    position: fixed;
    top: 0;
    left: 0;
    width: 100%;
    background: green;
    height: 50px;
    z-index: 2;
`;

const Group = styled.div`
    display: flex;
    align-items: center;
    justify-content: space-between;
`;

export default Navbar
export {Navbar}
